import React from 'react';
import './App.css';
import {connect} from "react-redux";
import {setName1Action, setName2Action} from "./actions/actions";

const App = props => {
 return (
     <div className="App">
        <div>
            <input type="text" />
        </div>
         <div>
             <input type="text" />
         </div>
     </div>
 )
};

const mapStateToProps = (state) => ({
    name1: state.name1,
    name2: state.name2
});

export default connect(mapStateToProps, { setName1Action, setName2Action })(App);
